import { Link, Routes, Route, Outlet, useParams } from "react-router-dom";
import Expenses from "./pages/expenses";
import Invoices from "./pages/invoices";
const GAMES = [
    { id: 1, home: true, opponent: 'Sequoia', date: new Date(), location: '', notes: 'notes about game' },
    { id: 2, home: false, opponent: 'Peachtree Ridge', date: new Date(), location: '', notes: 'notes about game' }
]


function App() {
    return (
        <Routes>
            <Route path="/" element={<Main />}>
                <Route path=":expenses" element={<Expenses />} />
                <Route path="invoices" element={<Invoices />} />
                <Route
                    path="*"
                    element={
                        <main style={{ padding: "1rem" }}>
                        <p>404 - There's nothing here!</p>
                        </main>
                    }
                />
            </Route>
        </Routes>
    )
}

function Main() {
    return (
        <div className="min-h-screen bg-red-200 md:px-16">
            <div className="w-100 m-auto bg-pink-100 max-w-7xl	">

                <div className="bg-yellow-100 p-3">
                    header component here

                    <Link to="/invoices">Invoices</Link> |{" "}
                    <Link to="/expenses">Expenses</Link>
                </div>
                haahah
            </div>

            <h1 className="font-bold underline">
                Hello world!
            </h1>

            <Outlet />

            <div className="flex">
                {GAMES.map(item => {
                    return (
                        <div className="p-4 bg-white mx-2">
                            <h3 className="text-center">
                                {item.home ? 'VS' : 'AT'}
                                <br /> 
                                {item.opponent}
                            </h3>

                        </div>
                    )
                })}
            </div>

        </div>
    );
}

export default App;
